import React, { useEffect } from 'react'
import { StyleSheet, Text, View, Image, TextInput, ScrollView, Keyboard, Alert, Button, TouchableOpacity } from 'react-native';
import axios from 'axios'
import AsyncStorage from '@react-native-async-storage/async-storage';
import { Box, Heading, VStack, FormControl, Input, Center, NativeBaseProvider, } from "native-base";
import { Formik, Form, Field } from 'formik';
import * as Yup from 'yup';
import { register } from "./authservice.js";


export default function Login({ navigation }) {

    const [loading, setLoading] = React.useState(false);
    const [failedLogin, setfailedLogin] = React.useState(false);

    const SignupSchema = Yup.object().shape({
        firstName: Yup.string()
            .min(2, 'Too Short!')
            .max(50, 'Too Long!')
            .required('Required'),
        lastName: Yup.string()
            .min(2, 'Too Short!')
            .max(50, 'Too Long!')
            .required('Required'),
        phone: Yup.string()
            .min(2, 'Too Short!')
            .max(50, 'Too Long!')
            .required('Required'),
        adress: Yup.string()
            .min(2, 'Too Short!')
            .max(50, 'Too Long!')
            .required('Required'),
        password: Yup.string()
            .min(2, 'Too Short!')
            .max(50, 'Too Long!')
            .required('Required'),
        confirmPassword: Yup.string()
            .oneOf([Yup.ref('password'), null], 'Passwords must match')
            .required('Required'),
        email: Yup.string().email('Invalid email').required('Required'),

    });




    useEffect(() => {
        /*   getDataFromStorage().then((val) => {
              if (val) {
                  navigation.navigate('AffectedZonesList')
              }
          }); */
    }, [])



    return (
        <View style={styles.container} >

            <Center w="100%">
                <Box safeArea p="2" w="90%" maxW="290" py="8" h="100%" >
                    <VStack space={3} mb="10">

                        <Heading mt="1" color="coolGray.600" _dark={{
                            color: "warmGray.200"
                        }} fontWeight="medium" size="xs">

                            <Image
                                style={styles.tinyLogo}
                                source={{
                                    uri: 'https://ey.co.il/wp-content/uploads/2021/11/logo-black.png',
                                }}
                            />
                        </Heading>
                        <Heading mt="1" color="coolGray.600" _dark={{
                            color: "warmGray.200"
                        }} fontWeight="medium" size="xs">
                            Sign up to continue!
                        </Heading>
                        {/*         <VStack space={3} mt="5">
                        <FormControl>
                            <FormControl.Label>firstName</FormControl.Label>
                            <Input />
                        </FormControl>
                        <FormControl>
                            <FormControl.Label>lastName</FormControl.Label>
                            <Input />
                        </FormControl>
                        <FormControl>
                            <FormControl.Label>phone</FormControl.Label>
                            <Input />
                        </FormControl>
                        <FormControl>
                            <FormControl.Label>adress</FormControl.Label>
                            <Input />
                        </FormControl>
                        <FormControl>
                            <FormControl.Label>Email</FormControl.Label>
                            <Input />
                        </FormControl>
                        <FormControl>
                            <FormControl.Label>Password</FormControl.Label>
                            <Input type="password" />
                        </FormControl>
                        <FormControl>
                            <FormControl.Label>Confirm Password</FormControl.Label>
                            <Input type="password" />
                        </FormControl>

                        <TouchableOpacity
                            style={styles.button}
                        >
                            <Text style={styles.textStyle}>REGISTER</Text>
                        </TouchableOpacity>
                    </VStack> */}
                    </VStack>

                    <Formik
                        initialValues={{ email: '', firstName: '', lastName: '', phone: '', adress: '', password: '', confirmPassword: '' }}
                        validationSchema={SignupSchema}
                        onSubmit={async values => {
                            const response = await register(values);
                            console.log(response);
                              console.log(values)

                          }}
                    >
                        {({ handleChange, handleBlur, handleSubmit, values, errors, touched }) => (
                            <View>
                                <FormControl.Label>first Name</FormControl.Label>
                                <Input
                                    onChangeText={handleChange('firstName')}
                                    onBlur={handleBlur('firstName')}
                                    value={values.firstName} />
                                {touched.firstName && errors.firstName && <Text>{errors.firstName}</Text>}

                                <FormControl.Label>Last Name</FormControl.Label>
                                <Input
                                    onChangeText={handleChange('lastName')}
                                    onBlur={handleBlur('lastName')}
                                    value={values.lastName} />
                                {touched.lastName && errors.lastName && <Text>{errors.lastName}</Text>}
                                <FormControl.Label>phone</FormControl.Label>

                                <Input
                                    onChangeText={handleChange('phone')}
                                    onBlur={handleBlur('phone')}
                                    value={values.phone} />
                                {touched.phone && errors.phone && <Text>{errors.phone}</Text>}
                                <FormControl.Label>adress</FormControl.Label>

                                <Input
                                    onChangeText={handleChange('adress')}
                                    onBlur={handleBlur('adress')}
                                    value={values.adress} />
                                {touched.adress && errors.adress && <Text>{errors.adress}</Text>}
                                <FormControl.Label>Email</FormControl.Label>

                                <Input
                                    onChangeText={handleChange('email')}
                                    onBlur={handleBlur('email')}
                                    value={values.email} />
                                {touched.email && errors.email && <Text>{errors.email}</Text>}
                                <FormControl.Label>password</FormControl.Label>

                                <Input
                                    onChangeText={handleChange('password')}
                                    onBlur={handleBlur('password')}
                                    value={values.password} secureTextEntry />
                                {touched.password && errors.password && <Text>{errors.password}</Text>}
                                <FormControl.Label>confirm Password</FormControl.Label>

                                <Input
                                    onChangeText={handleChange('confirmPassword')}
                                    onBlur={handleBlur('confirmPassword')}
                                    value={values.confirmPassword}
                                    secureTextEntry
                                />
                                {touched.confirmPassword && errors.confirmPassword && <Text>{errors.confirmPassword}</Text>}


                                <VStack space={3} mt="16" >
                                    <TouchableOpacity style={styles.button} onPress={handleSubmit}>
                                        <Text style={styles.textStyle}>REGISTER</Text>
                                    </TouchableOpacity>
                                </VStack>

                            </View>

                        )}

                    </Formik>
                </Box>
            </Center>;


        </View>

    )



}
const styles = StyleSheet.create({
    container: {
        flex: 1,
        /*  alignItems: 'center',
         justifyContent: 'center', */
    },
    container2: {

        alignItems: 'center',
        justifyContent: 'center',
    },
    tinyLogo: {
        width: 100,
        height: 100,
    },
    input: {
        height: 40,
        margin: 12,
        // borderWidth: 1,
    },

    button: {
        alignItems: "center",
        backgroundColor: "#2c2c3b",
        padding: 10,

    },
    textStyle: {
        color: "yellow",
        fontWeight: 500
    }
});
